import './App.css';

function App() {
  const[position, setPosition] = useState(true)
  const isSwitch = () => {
    setPosition(!position)
    s = "flex-start"
    if(position === true){
      s = "flex-start"
    }else{
      s = "flex-end"
    }
    console.log(position)
  }
  return (
    <div className="App">     
      <div className="switch-outer" style={{justifyContent: {s} }} onClick={isSwitch}>
        <div className="switch-inner">
        </div>
      </div>
    </div>
  );
}

export default App;
